{'action': 'closed', 'issue': {'url': 'https://api.github.com/repos/spring-projects/spring-boot/issues/30777', 'repository_url': 'https://api.github.com/repos/spring-projects/spring-boot', 'labels_url': 'https://api.github.com/repos/spring-projects/spring-boot/issues/30777/labels{/name}', 'comments_url': 'https://api.github.com/repos/spring-projects/spring-boot/issues/30777/comments', 'events_url': 'https://api.github.com/repos/spring-projects/spring-boot/issues/30777/events', 'html_url': 'https://github.com/spring-projects/spring-boot/issues/30777', 'id': 1213181115, 'node_id': 'I_kwDOAGAU1s5IT6y7', 'number': 30777, 'title': 'Lombok version in 2.6.7 breaks code', 'user': {'login': 'HayoBaanAtHand', 'id': 68533277, 'node_id': 'MDQ6VXNlcjY4NTMzMjc3', 'avatar_url': 'https://avatars.githubusercontent.com/u/68533277?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/HayoBaanAtHand', 'html_url': 'https://github.com/HayoBaanAtHand', 'followers_url': 'https://api.github.com/users/HayoBaanAtHand/followers', 'following_url': 'https://api.github.com/users/HayoBaanAtHand/following{/other_user}', 'gists_url': 'https://api.github.com/users/HayoBaanAtHand/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/HayoBaanAtHand/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/HayoBaanAtHand/subscriptions', 'organizations_url': 'https://api.github.com/users/HayoBaanAtHand/orgs', 'repos_url': 'https://api.github.com/users/HayoBaanAtHand/repos', 'events_url': 'https://api.github.com/users/HayoBaanAtHand/events{/privacy}', 'received_events_url': 'https://api.github.com/users/HayoBaanAtHand/received_events', 'type': 'User', 'site_admin': False}, 'labels': [{'id': 293438798, 'node_id': 'MDU6TGFiZWwyOTM0Mzg3OTg=', 'url': 'https://api.github.com/repos/spring-projects/spring-boot/labels/status:%20waiting-for-triage', 'name': 'status: waiting-for-triage', 'color': 'fef2c0', 'default': False, 'description': "An issue we've not yet triaged"}], 'state': 'closed', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': None, 'comments': 1, 'created_at': '2022-04-23T03:33:30Z', 'updated_at': '2022-04-23T06:18:17Z', 'closed_at': '2022-04-23T06:18:17Z', 'author_association': 'NONE', 'active_lock_reason': None, 'body': "With Spring Boot 2.6.7 you also updated the version of lombok. This version of Lombok propagates (some of) the field annotations to the generated getters and setters. This is not always valid/desired and actually leads to valid code breaking (at runtime).

Simple case:
```
public interface BaseEntityDto {

    /**
     * Returns the ID of the entity.
     *
     * @return the ID of the entity.
     */
    Long getId();

    /**
     * Sets the ID of the entity.
     *
     * @param id the ID of the entity.
     */
    void setId(Long id);

    /**
     * Returns the timestamp of the last update of the entity.
     *
     * @return the timestamp of the last update.
     */
    Instant getUpdateTimestamp();

    /**
     * Sets the timestamp of the last update of the entity.
     *
     * @param updateTimestamp the timestamp of the last update.
     */
    void setUpdateTimestamp(Instant updateTimestamp);

    /**
     * Returns the version of the entity.
     *
     * @return the version of the entity.
     */
    Long getVersion();

    /**
     * Sets the version of the entity.
     *
     * @param version the version of the entity.
     */
    void setVersion(Long version);

}

@Data
public class AccountDto implements BaseEntityDto {

    /**
     * Interface for annotating the validation group for account creation.
     */
    public interface CreateValidation {}

    @Null(groups = CreateValidation.class)
    @NotNull
    @Positive
    private Long id;

    @NotBlank(groups = {Default.class, CreateValidation.class})
    private String name;

    private Instant updateTimestamp;

    @NotNull
    @Null(groups = CreateValidation.class)
    private Long version;
}
```

Here for example, the setter (and getter) of ID get annotated with `@NotNull`. However this is a perfectly valid (actually mandatory) value when the AccountDto object is validated with CreateValidation. Moreover, at runtime you get an `javax.validation.ConstraintDeclarationException - HV000151: A method overriding another method must not redefine the parameter constraint configuration` exception as the interface defines no constraints, but the implementation now does.

Adding the constraint to the interface is no solution as for one class of objects I might need different _object_ validation than for another while they still inherit from the BaseEnityDto interface. Besides, I want just the _end-state_ of the object validated (and then depending on the applicable validation group), not the intermediate states!

I've raised this issue also with Lombok: https://github.com/projectlombok/lombok/issues/3180", 'reactions': {'url': 'https://api.github.com/repos/spring-projects/spring-boot/issues/30777/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/spring-projects/spring-boot/issues/30777/timeline', 'performed_via_github_app': None}}

