Java version affected: 11
---

I have a class that implements an interface, I have an aspect that targets a method implemented by my class with an `Around` advice (targeting an annotation with my pointcut expression). The constructor is private on my service class, its coming from a library out of my control. Even though my service class implements an interface, for some reason CGLib continues to be used for proxying instead of a JDK proxy. When using Java 8, the code works perfectly fine, however when switched to Java 11 the exception is thrown:

```
java.lang.IllegalStateException: Failed to load ApplicationContext
Caused by: org.springframework.beans.factory.UnsatisfiedDependencyException: Error creating bean with name 'springAopIssueApplication': Unsatisfied dependency expressed through method 'setMyService' parameter 0; nested exception is org.springframework.beans.factory.BeanCreationException: Error creating bean with name 'myService' defined in test.springaopissue.SpringAopIssueApplication$MyConfig: Initialization of bean failed; nested exception is org.springframework.aop.framework.AopConfigException: Could not generate CGLIB subclass of class test.springaopissue.SpringAopIssueApplication$MyServiceImpl: Common causes of this problem include using a final class or a non-visible class; nested exception is java.lang.IllegalArgumentException: No visible constructors in class test.springaopissue.SpringAopIssueApplication$MyServiceImpl
Caused by: org.springframework.beans.factory.BeanCreationException: Error creating bean with name 'myService' defined in test.springaopissue.SpringAopIssueApplication$MyConfig: Initialization of bean failed; nested exception is org.springframework.aop.framework.AopConfigException: Could not generate CGLIB subclass of class test.springaopissue.SpringAopIssueApplication$MyServiceImpl: Common causes of this problem include using a final class or a non-visible class; nested exception is java.lang.IllegalArgumentException: No visible constructors in class test.springaopissue.SpringAopIssueApplication$MyServiceImpl
Caused by: org.springframework.aop.framework.AopConfigException: Could not generate CGLIB subclass of class test.springaopissue.SpringAopIssueApplication$MyServiceImpl: Common causes of this problem include using a final class or a non-visible class; nested exception is java.lang.IllegalArgumentException: No visible constructors in class test.springaopissue.SpringAopIssueApplication$MyServiceImpl
Caused by: java.lang.IllegalArgumentException: No visible constructors in class test.springaopissue.SpringAopIssueApplication$MyServiceImpl
```

The following code reproduces the issue:

```java
package test.springaopissue;

import java.lang.annotation.ElementType;
import java.lang.annotation.Inherited;
import java.lang.annotation.Retention;
import java.lang.annotation.RetentionPolicy;
import java.lang.annotation.Target;

import org.aspectj.lang.ProceedingJoinPoint;
import org.aspectj.lang.annotation.Around;
import org.aspectj.lang.annotation.Aspect;
import org.slf4j.Logger;
import org.slf4j.LoggerFactory;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.ApplicationArguments;
import org.springframework.boot.ApplicationRunner;
import org.springframework.boot.SpringApplication;
import org.springframework.boot.autoconfigure.SpringBootApplication;
import org.springframework.context.annotation.Bean;
import org.springframework.context.annotation.Configuration;
import org.springframework.context.annotation.EnableAspectJAutoProxy;
import org.springframework.stereotype.Component;

@SpringBootApplication
@EnableAspectJAutoProxy
public class SpringAopIssueApplication implements ApplicationRunner {
    private MyService myService;

    public static void main(final String[] args) {
        SpringApplication.run(SpringAopIssueApplication.class, args);
    }

    @Override
    public void run(final ApplicationArguments args) throws Exception {
        myService.myMethod();
    }

    @Autowired
    public void setMyService(final MyService myService) {
        this.myService = myService;
    }

    @Target({ ElementType.ANNOTATION_TYPE, ElementType.TYPE, ElementType.METHOD })
    @Retention(RetentionPolicy.RUNTIME)
    @Inherited
    public @interface MyAnnotation {
    }

    @Configuration
    public class MyConfig {

        @Bean
        MyService myService() {
            return MyServiceImpl.newBuilder()
                    .build();
        }
    }

    @Aspect
    @Component
    public static class MyAspect {
        private static final Logger LOGGER = LoggerFactory.getLogger(MyAspect.class);

        @Around("execution (@test.springaopissue.SpringAopIssueApplication.MyAnnotation * *.*(..))")
        public Object surround(final ProceedingJoinPoint pjp) throws Throwable {
            try {
                LOGGER.info("Starting execution...");
                return pjp.proceed();
            } finally {
                LOGGER.info("... done executing");
            }
        }
    }

    public interface MyService {
        void myMethod();
    }

    public static class MyServiceImpl implements MyService {
        private static final Logger LOGGER = LoggerFactory.getLogger(MyServiceImpl.class);

        private MyServiceImpl() {
        }

        @MyAnnotation
        @Override
        public void myMethod() {
            LOGGER.info("executing myMethod");
        }

        public static Builder newBuilder() {
            return new Builder();
        }

        public static class Builder {
            private Builder() {
            }

            public MyService build() {
                return new MyServiceImpl();
            }
        }
    }
}
```

To reproduce use 	

```xml
<properties>
  <java.version>11</java.version>
</properties>
```

If you switch to java 8 the issue goes away:

```xml
<properties>
  <java.version>1.8</java.version>
</properties>
```
